import Topbar from "./components/Topbar";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Todo from "./components/Todo";
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Topbar></Topbar>
        <div className="contentWrapper">
          <Switch>
            <Route path="/">
              <Todo></Todo>
            </Route>
          </Switch>
          {/* <Todo /> */}
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
